import React from 'react'
import { heroData } from './heroData'

function Hero() {
    return (
        <div>
            {heroData.map((slide, index) => {
                return (
                    <img src={slide.image} alt={index} key={index}/>
                )
            })}
        </div>
    )
}

export default Hero
